  "translationLines": [
    {
      "lineNumber": 224082,
      "originalJapaneseLine": "「……それをあたしに調査しろっての？」",
      "translatedEnglishLine": "\"...You want me to investigate that?\""
    },
    {
      "lineNumber": 224083,
      "originalJapaneseLine": "「ん？　そんなことを依頼したつもりはないぞ？」",
      "translatedEnglishLine": "\"Hmm? I didn't mean to ask you to do that, you know?\""
    },
    {
      "lineNumber": 224084,
      "originalJapaneseLine": "「まあ……いつも研究室と病院に",
      "translatedEnglishLine": "\"Well... since you're always holed up in the lab and hospital"
    },
    {
      "lineNumber": 224085,
      "originalJapaneseLine": "　こもっているお前には良い経験だ」",
      "translatedEnglishLine": "it's good experience for you.\""
    },
    {
      "lineNumber": 224086,
      "originalJapaneseLine": "「……どういう意味？」",
      "translatedEnglishLine": "\"...What do you mean?\""
    },
    {
      "lineNumber": 224087,
      "originalJapaneseLine": "「今回の旅は家族旅行みたいなものだと",
      "translatedEnglishLine": "\"Remember, Reset Color said this trip is like a family vacation"
    },
    {
      "lineNumber": 224088,
      "originalJapaneseLine": "　リセット・カラーが言っていたのは",
      "translatedEnglishLine": "just now?\""
    },
    {
      "lineNumber": 224089,
      "originalJapaneseLine": "　覚えているな？」",
      "translatedEnglishLine": "(Combined with above line.)"
    },
    {
      "lineNumber": 224090,
      "originalJapaneseLine": "「世界の命運を決める大事な戦いだが、",
      "translatedEnglishLine": "\"This is an important battle that will decide the world's fate,"
    },
    {
      "lineNumber": 224091,
      "originalJapaneseLine": "　確かにそういう一面は大いにある」",
      "translatedEnglishLine": "but it certainly has that side to it as well.\""
    },
    {
      "lineNumber": 224092,
      "originalJapaneseLine": "「今までお前はそういう親交がなかったからな、",
      "translatedEnglishLine": "\"You haven't had that kind of camaraderie before,"
    },
    {
      "lineNumber": 224093,
      "originalJapaneseLine": "　今回のことは良いきっかけだ。",
      "translatedEnglishLine": "so this is a good opportunity."
    },
    {
      "lineNumber": 224094,
      "originalJapaneseLine": "　少しは兄弟姉妹達と旅を楽しんで来い」",
      "translatedEnglishLine": "Enjoy traveling a bit with your brothers and sisters.\""
    },
    {
      "lineNumber": 224095,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 224096,
      "originalJapaneseLine": "「……ん？」",
      "translatedEnglishLine": "\"...Hm?\""
    },
    {
      "lineNumber": 224097,
      "originalJapaneseLine": "「あんた、それ、本気で言っているわね？」",
      "translatedEnglishLine": "\"You're serious about that, aren't you?\""
    },
    {
      "lineNumber": 224098,
      "originalJapaneseLine": "「余は適当なことは言うが、",
      "translatedEnglishLine": "\"I may say whatever I like,"
    },
    {
      "lineNumber": 224099,
      "originalJapaneseLine": "　いつだって本気だ」",
      "translatedEnglishLine": "but I'm always serious.\""
    },
    {
      "lineNumber": 224100,
      "originalJapaneseLine": "「あんたに相談したあたしが間違ってた！」",
      "translatedEnglishLine": "\"I was wrong to consult you!\""
    },
    {
      "lineNumber": 224101,
      "originalJapaneseLine": "ミックスが乱暴に扉を開け閉めして出て行った。",
      "translatedEnglishLine": "Mix slammed the door open and closed roughly and left."
    },
    {
      "lineNumber": 224102,
      "originalJapaneseLine": "「はっはっはっ、短気な娘だ。",
      "translatedEnglishLine": "\"Ha ha ha, such a short-tempered girl."
    },
    {
      "lineNumber": 224103,
      "originalJapaneseLine": "　あれだけは我が家系の誰に似たのか分からんな」",
      "translatedEnglishLine": "I don't know who in our family she takes after.\""
    },
    {
      "lineNumber": 224104,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 224105,
      "originalJapaneseLine": "ミラクルが窓の外を眺める。",
      "translatedEnglishLine": "Miracle gazed out the window."
    },
    {
      "lineNumber": 224106,
      "originalJapaneseLine": "そこには吸い込まれそうな風景が",
      "translatedEnglishLine": "There was a captivating landscape"
    },
    {
      "lineNumber": 224107,
      "originalJapaneseLine": "無限に広がっていた。",
      "translatedEnglishLine": "that spread infinitely."
    },
    {
      "lineNumber": 224108,
      "originalJapaneseLine": "「さーて、法王クルックー・モフスよ。",
      "translatedEnglishLine": "\"Now then, Pope Krukku Mofusu."
    },
    {
      "lineNumber": 224109,
      "originalJapaneseLine": "　いったい何を企んでいる？」",
      "translatedEnglishLine": "What exactly are you scheming?\""
    },
    {
      "lineNumber": 224110,
      "originalJapaneseLine": "「余はせいぜい高みの見物とさせてもらうぞ」",
      "translatedEnglishLine": "\"I will at most watch this from on high.\""
    },
    {
      "lineNumber": 224111,
      "originalJapaneseLine": "「クククク……」",
      "translatedEnglishLine": "\"Ku ku ku ku...\""
    },
    {
      "lineNumber": 224112,
      "originalJapaneseLine": "次の日――",
      "translatedEnglishLine": "The next day—"
    },
    {
      "lineNumber": 224113,
      "originalJapaneseLine": "あなた達は異界ゲートを通って、",
      "translatedEnglishLine": "You all passed through the otherworld gate,"
    },
    {
      "lineNumber": 224114,
      "originalJapaneseLine": "ようやく元の世界に帰ってきた。",
      "translatedEnglishLine": "and finally returned to the original world."
    },
    {
      "lineNumber": 224115,
      "originalJapaneseLine": "「うっ……くぅーーーっ！」",
      "translatedEnglishLine": "\"Ugh... kuuu---!\""
    },
    {
      "lineNumber": 224116,
      "originalJapaneseLine": "「はあ、ほぼ丸一日の無駄な冒険だったな」",
      "translatedEnglishLine": "\"Hah, that was almost a whole day's wasted adventure.\""
    },
    {
      "lineNumber": 224117,
      "originalJapaneseLine": "「あの人に巻き込まれると……",
      "translatedEnglishLine": "\"When you get dragged into things by that person..."
    },
    {
      "lineNumber": 224118,
      "originalJapaneseLine": "　疲労度が他のそれを軽く凌駕するな……」",
      "translatedEnglishLine": "fatigue easily surpasses any other.\""
    },
    {
      "lineNumber": 224119,
      "originalJapaneseLine": "睡眠はたっぷり取った筈にも関わらず、",
      "translatedEnglishLine": "Although you should have gotten plenty of sleep,"
    },
    {
      "lineNumber": 224120,
      "originalJapaneseLine": "皆がどこか妙に疲れていた。",
      "translatedEnglishLine": "everyone felt strangely exhausted somehow."
    },
    {
      "lineNumber": 224121,
      "originalJapaneseLine": "「でもでも、無駄な冒険じゃなかったよ」",
      "translatedEnglishLine": "\"But but, it wasn't a wasted adventure.\""
    },
    {
      "lineNumber": 224122,
      "originalJapaneseLine": "「ほら、こうしてミックスちゃんが",
      "translatedEnglishLine": "\"Look, just like this, Mix-chan"
    },
    {
      "lineNumber": 224123,
      "originalJapaneseLine": "　一緒に来てくれることになったんだから！」",
      "translatedEnglishLine": "has agreed to come along with us!\""
    },
    {
      "lineNumber": 224124,
      "originalJapaneseLine": "「はああああ……」",
      "translatedEnglishLine": "\"Haaahhh...\""
    },
    {
      "lineNumber": 224125,
      "originalJapaneseLine": "「まったく、なんでこんなことに……",
      "translatedEnglishLine": "\"Good grief, why did it have to come to this..."
    },
    {
      "lineNumber": 224126,
      "originalJapaneseLine": "　落ち着いたらキャロリに手紙出して、",
      "translatedEnglishLine": "Once I calm down, I'll have to send a letter to Caroli,"
    },
    {
      "lineNumber": 224127,
      "originalJapaneseLine": "　病院運営に関して指示出さないと……」",
      "translatedEnglishLine": "and give instructions about managing the hospital...\""
    },
    {
      "lineNumber": 224128,
      "originalJapaneseLine": "「＜エール＞ちゃんも嬉しいでしょ？」",
      "translatedEnglishLine": "\"Aren't you happy too, <Yell>-chan?\""
    },
    {
      "lineNumber": 224129,
      "originalJapaneseLine": "あなたはパチッとミックスと目が合った。",
      "translatedEnglishLine": "You suddenly made eye contact with Mix."
    },
    {
      "lineNumber": 224130,
      "originalJapaneseLine": "「……あによ？」",
      "translatedEnglishLine": "\"...What's that?\""
    },
    {
      "lineNumber": 224131,
      "originalJapaneseLine": "「…………。」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 224132,
      "originalJapaneseLine": "「ん……」",
      "translatedEnglishLine": "\"Hmm...\""
    },
    {
      "lineNumber": 224133,
      "originalJapaneseLine": "「それはどうも……」",
      "translatedEnglishLine": "\"Well, thank you for that...\""
    },
    {
      "lineNumber": 224134,
      "originalJapaneseLine": "ミックスは少し照れているような……",
      "translatedEnglishLine": "Mix seemed a little embarrassed..."
    },
    {
      "lineNumber": 224135,
      "originalJapaneseLine": "そんなことはないような……",
      "translatedEnglishLine": "or maybe not..."
    },
    {
      "lineNumber": 224136,
      "originalJapaneseLine": "なんとも曖昧な表情を浮かべた。",
      "translatedEnglishLine": "She wore an ambiguous expression."
    },
    {
      "lineNumber": 224137,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 224138,
      "originalJapaneseLine": "「ま、よろしく。",
      "translatedEnglishLine": "\"Well, nice to meet you."
    },
    {
      "lineNumber": 224139,
      "originalJapaneseLine": "　リーダー」",
      "translatedEnglishLine": "Leader.\""
    },
    {
      "lineNumber": 224140,
      "originalJapaneseLine": "ミックスは呆れの混じった",
      "translatedEnglishLine": "Mix answered with a mixture of exasperation"
    },
    {
      "lineNumber": 224141,
      "originalJapaneseLine": "アンニュイな表情で答えた。",
      "translatedEnglishLine": "and ennui on her face."
    }
  ]
}

